

def PatternMatching(pattern, text):
    k = len(pattern)
    indeces = []
    for i in range(len(text) + 1 - k):
        if text[i:i+k] == pattern:
            indeces.append(i)
    return indeces


def FrequentWords(text, k):
    freq_dict = {}
    for i in range(len(text) + 1 - k):
        key = text[i:i+k]
        if key in freq_dict.keys():
            freq_dict[key] = freq_dict[key] + 1
        else:
            freq_dict[key] = 1
    max_freq = max(freq_dict.values())
    return [k for k in freq_dict.keys() if freq_dict[k]==max_freq ]


def pattern_match(gene, pattern):
    """

    :param gene:
    :param pattern: pattern to be searched for
    :param max_d: max hamming distance acceptable
    :return: number of approximate matches
    """
    patterns = []
    l = len(pattern)
    for i in range(len(gene)-l + 1):
        if gene[i:i+l] == pattern:
            patterns.append(str(i))
    return patterns





